import React, {useState} from 'react';

const Form=()=>{

    let [NewName,update]=useState();

    const Input=(event)=>{
        update(event.target.value);
            
        }
    return (
        <>
        <label htmlFor="">Hello {NewName}</label> <br />
        <input type="text" onChange={Input} /><br />
        <button type='submit'>Submit</button>
        </>
    )
}

export default Form;
